int main() {
    char query[MAX_LEN + 1];
    int queries = 0;
    int edit_dist;

    // Guess a random password to start
    char password[MAX_LEN + 1] = "a";

    while (queries < MAX_QUERIES) {
        // Ask the query
        printf("? %s\n", password);
        fflush(stdout);

        // Get the edit distance from the judge
        scanf("%d", &edit_dist);

        // If edit distance is 0, we found the password
        if (edit_dist == 0) {
            printf("! %s\n", password);
            fflush(stdout);
            return 0;
        }

        // Modify the password based on the edit distance
        // This is a simple strategy, more sophisticated approaches can be used
        if (edit_dist == 1) {
            // Try adding a character to the password
            for (int i = 0; i < 26; ++i) {
                password[strlen(password)] = 'a' + i;
                printf("? %s\n", password);
                fflush(stdout);
                scanf("%d", &edit_dist);
                if (edit_dist == 0) {
                    printf("! %s\n", password);
                    fflush(stdout);
                    return 0;
                }
                password[strlen(password) - 1] = '\0';
            }
            // Try replacing a character in the password
            for (int i = 0; i < strlen(password); ++i) {
                for (int j = 0; j < 26; ++j) {
                    password[i] = 'a' + j;
                    printf("? %s\n", password);
                    fflush(stdout);
                    scanf("%d", &edit_dist);
                    if (edit_dist == 0) {
                        printf("! %s\n", password);
                        fflush(stdout);
                        return 0;
                    }
                    password[i] = 'a' + i;
                }
            }
        } else {
            // Try removing a character from the password
            for (int i = 0; i < strlen(password); ++i) {
                char tmp[MAX_LEN + 1];
                strcpy(tmp, password);
                tmp[i] = '\0';
                printf("? %s\n", tmp);
                fflush(stdout);
                scanf("%d", &edit_dist);
                if (edit_dist == 0) {
                    printf("! %s\n", tmp);
                    fflush(stdout);
                    return 0;
                }
            }
        }

        queries++;
    }

    return 0;
}
